//*This section defines the loadModel function, which loads a 3D model using the Three.js library. 
//*It takes parameters a (an object), b (a name for the model), c (the model file path), and d (the 
//*UV map URI). The function uses the TextureLoader and JSONLoader to load the model and its 
//*texture, creates a mesh, and then executes an "AddObjectCommand" on the provided object a.*/

loadModel = function(a, b, c, d) {
    (new THREE.TextureLoader).load(d, function(d) {
        var e = new THREE.MeshBasicMaterial({
            map: d,
            side: THREE.DoubleSide
        });
        (new THREE.JSONLoader).load(c, function(c) {
            var d = new THREE.Mesh(c,e);
            d.name = b,
            a.execute(new AddObjectCommand(d))
        })
    })
}
